	<div>
		<h1 className={"titulo"}>Bienvenidos a la Capacitacion de React con Router v4!</h1>
		<br/>
		<h2>Empezar de cero:</h2>
		<br/>
		<EmpezarReact/>
	</div>
);

export default Home;
